//Import React
import React, { useState } from 'react';
//Import Commands
import { StatusBar } from 'expo-status-bar';
import { Text, View, Button, Linking, TextInput } from 'react-native';
//Import Files
import styles from "./Styles";

import { HunterButton } from './Hunter';
import { HuntedButton } from './Hunted';


// MAIN //
export default class App extends React.Component {
  
  render() {
    return (
      <View style={styles.body}>
      <StatusBar style="auto" />

      <View style={styles.content1}>
        <Text style={styles.title}>WorldScape</Text>
      </View>

      <View>
        {!this.state.ready &&
          (<Text style={styles.text}>No known location</Text>)}
        {this.state.ready &&
          (<Text style={styles.text}>Latitude: {this.state.where.lat} Longitude: {this.state.where.lat}</Text>)}
        {this.state.error && 
          (<Text style={styles.text}>{this.state.error}</Text>)}
      </View>

      <View style={styles.mainButtons}>
        <HunterButton />
        <HuntedButton />
      </View>

    </View>
    );
  }
}
